import styles from './Polar.module.scss';
import { useNavigate } from 'react-router-dom';
import Button from '../../components/Button/Button';
import BackButton from '../../components/BackButton/BackButton';

function Polar() {
	const navigate = useNavigate();

    const handleClickRadio = () => {
        navigate('/radio');
    };

    const handleClickConnect = () => {
        navigate('/connect');
    };
	 

    return (
        <div className={styles.wrapper}>
            <div className={styles.content}>
                <Button className={styles.margin} onClick={handleClickRadio} />
                <Button className={styles.margin} onClick={handleClickConnect} />
            </div>
            <BackButton className={styles.backButton} onClick={handleClickBack} />
        </div>
    );
}

export default Polar;
